import React from "react"
import Question from "./Question"

function Quiz() {
    const elems =  [...Array(5).keys()].map(elem => <Question key={elem} id={elem} /> )
    return (
       <div className="quiz">
            {elems}
            <button>New Questions</button>
       </div>
    )
}

export default Quiz
